INSERT INTO `content` VALUES (104,'โคกหนองนาโมเดล1','<span style=\"color: rgb(34, 34, 34); font-size: 13.2px; background-color: white; font-family: helvetica, arial, &quot;lucida grande&quot;, sans-serif; line-height: 18.76px;\"><span style=\"color: rgb(56, 118, 29);\"><u style=\"font-weight: bold;\">โคก-หนอง-นา โมเดล&nbsp;</u>&nbsp;</span><span style=\"color: rgb(102, 102, 102);\">คือ&nbsp;</span></span><span style=\"font-size: 13.2px; background-color: white; color: rgb(102, 102, 102); font-family: helvetica, arial, &quot;lucida grande&quot;, sans-serif; line-height: 18.76px;\">การจัดการพื้นที่ซึ่งเหมาะกับพื้นที่การเกษตร</span><span style=\"font-size: 13.2px; background-color: white; color: rgb(102, 102, 102); font-family: helvetica, arial, &quot;lucida grande&quot;, sans-serif; line-height: 18.76px;\">&nbsp;</span><span style=\"font-size: 13.2px; background-color: white; color: rgb(102, 102, 102); font-family: helvetica, arial, &quot;lucida grande&quot;, sans-serif; line-height: 18.76px;\">ซึ่งเป็นผสมผสานเกษตรทฤษฎีใหม่&nbsp;</span><span style=\"font-size: 13.2px; background-color: white; color: rgb(102, 102, 102); font-family: helvetica, arial, &quot;lucida grande&quot;, sans-serif; line-height: 18.76px;\">เข้ากับภูมิปัญญาพื้นบ้านที่อยู่อย่างสอดคล้องกับธรรมชาติในพื้นที่นั้นๆ &nbsp;</span><b style=\"font-size: 13.2px; background-color: rgb(255, 255, 255); color: rgb(102, 102, 102); font-family: helvetica, arial, &quot;lucida grande&quot;, sans-serif; line-height: 18.76px;\">โคก-หนอง-นา โมเดล</b><b style=\"font-size: 13.2px; background-color: rgb(255, 255, 255); color: rgb(102, 102, 102); font-family: helvetica, arial, &quot;lucida grande&quot;, sans-serif; line-height: 18.76px;\">&nbsp;</b><span style=\"font-size: 13.2px; background-color: rgb(255, 255, 255); color: rgb(102, 102, 102); font-family: helvetica, arial, &quot;lucida grande&quot;, sans-serif; line-height: 18.76px;\">เป็นการที่</span><span style=\"font-size: 13.2px; background-color: white; color: rgb(102, 102, 102); font-family: helvetica, arial, &quot;lucida grande&quot;, sans-serif; line-height: 18.76px;\">ให้ธรรมชาติจัดการตัวมันเองโดยมี มนุษย์เป็นส่วนส่งเสริมให้มันสำเร็จเร็วขึ้น อย่างเป็นระบบ</span>','/video/model_1.mp4',3,47,'2016-11-29 08:27:49',63,'/img/w2g/logo_w2g'),(106,'โคกหนองนาโมเดล2','<p ng-bind-html=\"renderHtml(data.con_description)\" class=\"ng-binding\" style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; color: rgb(34, 34, 34); font-size: 13.2px; font-family: helvetica, arial, &quot;lucida grande&quot;, sans-serif; line-height: 18.76px;\"><span style=\"box-sizing: border-box; color: rgb(56, 118, 29);\"><u style=\"box-sizing: border-box; font-weight: bold;\">โคก-หนอง-นา โมเดล&nbsp;</u>&nbsp;</span><span style=\"box-sizing: border-box; color: rgb(102, 102, 102);\">คือ&nbsp;</span></span><span style=\"box-sizing: border-box; font-size: 13.2px; color: rgb(102, 102, 102); font-family: helvetica, arial, &quot;lucida grande&quot;, sans-serif; line-height: 18.76px;\">การจัดการพื้นที่ซึ่งเหมาะกับพื้นที่การเกษตร</span><span style=\"box-sizing: border-box; font-size: 13.2px; color: rgb(102, 102, 102); font-family: helvetica, arial, &quot;lucida grande&quot;, sans-serif; line-height: 18.76px;\">&nbsp;</span><span style=\"box-sizing: border-box; font-size: 13.2px; color: rgb(102, 102, 102); font-family: helvetica, arial, &quot;lucida grande&quot;, sans-serif; line-height: 18.76px;\">ซึ่งเป็นผสมผสานเกษตรทฤษฎีใหม่&nbsp;</span><span style=\"box-sizing: border-box; font-size: 13.2px; color: rgb(102, 102, 102); font-family: helvetica, arial, &quot;lucida grande&quot;, sans-serif; line-height: 18.76px;\">เข้ากับภูมิปัญญาพื้นบ้านที่อยู่อย่างสอดคล้องกับธรรมชาติในพื้นที่นั้นๆ &nbsp;</span><span style=\"box-sizing: border-box; font-weight: 700; font-size: 13.2px; color: rgb(102, 102, 102); font-family: helvetica, arial, &quot;lucida grande&quot;, sans-serif; line-height: 18.76px;\">โคก-หนอง-นา โมเดล</span><span style=\"box-sizing: border-box; font-weight: 700; font-size: 13.2px; color: rgb(102, 102, 102); font-family: helvetica, arial, &quot;lucida grande&quot;, sans-serif; line-height: 18.76px;\">&nbsp;</span><span style=\"box-sizing: border-box; font-size: 13.2px; color: rgb(102, 102, 102); font-family: helvetica, arial, &quot;lucida grande&quot;, sans-serif; line-height: 18.76px;\">เป็นการที่</span><span style=\"box-sizing: border-box; font-size: 13.2px; color: rgb(102, 102, 102); font-family: helvetica, arial, &quot;lucida grande&quot;, sans-serif; line-height: 18.76px;\">ให้ธรรมชาติจัดการตัวมันเองโดยมี มนุษย์เป็นส่วนส่งเสริมให้มันสำเร็จเร็วขึ้น อย่างเป็นระบบ</span></p><div><span style=\"box-sizing: border-box; font-size: 13.2px; color: rgb(102, 102, 102); font-family: helvetica, arial, &quot;lucida grande&quot;, sans-serif; line-height: 18.76px;\"><br></span></div>','/video/model_2.mp4',3,48,'2016-11-24 07:08:39',15,'/img/w2g/logo_w2g'),(107,'ปลูกพืชในกระถาง','<p style=\"padding: 0px; margin: 1.6em 0px; outline: none; list-style: none; border: 0px none; line-height: 1.6em; font-size: 16px; color: rgb(34, 34, 34); font-family: &quot;Open Sans&quot;, sans-serif; background-color: rgb(255, 255, 255);\"><strong style=\"padding: 0px; margin: 0px; outline: none; list-style: none; border: 0px none;\">เคล็ดลับการปลูกผักในกระถางมีดังนี้</strong></p><p style=\"padding: 0px; margin: 1.6em 0px; outline: none; list-style: none; border: 0px none; line-height: 1.6em; font-size: 16px; color: rgb(34, 34, 34); font-family: &quot;Open Sans&quot;, sans-serif; background-color: rgb(255, 255, 255);\">เตรียมดิน ดินปลูกไม้กระถางต้องเป็นดินร่วน โปร่งระบายน้ำดี (ถ้าใช้ดินที่ขายตามท้อง ตลาดอย่างเดียวเมื่อใช้ไปนานดินจะแน่น) ต้องเป็นดินผสม &nbsp;ดินที่เหมาะสำหรับปลูกไม้กระถางมีอัตราส่วนดังนี้</p><p style=\"padding: 0px; margin: 1.6em 0px; outline: none; list-style: none; border: 0px none; line-height: 1.6em; font-size: 16px; color: rgb(34, 34, 34); font-family: &quot;Open Sans&quot;, sans-serif; background-color: rgb(255, 255, 255);\">ดินร่วน (หรือดินที่ผสมขาย) : ปุ๋ยคอก: ปุ๋ยหมัก: แกลบดิบ: ใบไม้ผุ อัตราส่วนที่ใช้อย่างละ 1 ส่วน ผสมให้เข้ากัน (ห้ามใช้กาบมะพร้าวสับเพราะจะทำให้เกิดเชื้อรา)</p><p style=\"padding: 0px; margin: 1.6em 0px; outline: none; list-style: none; border: 0px none; line-height: 1.6em; font-size: 16px; color: rgb(34, 34, 34); font-family: &quot;Open Sans&quot;, sans-serif; background-color: rgb(255, 255, 255);\">ปุ๋ย ปุ๋ยที่ใช้เป็นปุ๋ยสูตรเสมอ เช่น 16-16-16 ห่อกระดาษหนัง สือพิมพ์ จากนั้นเจาะดินในกระถางปุ๋ย ใส่ปุ๋ยที่เตรียมไว้ใส่ลงไปในรูที่เจาะ กระถางละ 3 จุด (ควรเปลี่ยนทุกเดือน)</p>','/video/vegetable.mp4',3,49,'2016-11-24 07:09:00',13,'/img/w2g/logo_w2g'),(108,'หมอดิน','<br><table bgcolor=\"#FFFFFF\" width=\"800\" height=\"1162\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" style=\"font-family: Times; font-size: medium;\"><tbody><tr><td height=\"96\" colspan=\"5\"><b>หมอดินอาสา</b><span class=\"style14\" style=\"font-family: sans-serif; font-size: 12px;\"></span><span class=\"style11\" style=\"font-family: sans-serif; font-size: 12px;\">&nbsp;คือ</span><span class=\"style11\" style=\"font-family: sans-serif; font-size: 12px;\">&nbsp;เ<i>กษตรกรที่เป็นตัวแทนของกรมพัฒนาที่ดิน ในพื้นที่ ซึ่งได้จัดตั้งเป็นเครือข่ายปฏิบัติงานในระดับหมู่บ้าน ตำบล และอำเภอ&nbsp;</i></span><i><span style=\"font-family: sans-serif; font-size: 12px;\">หมอดินอาสาประจำตำบล&nbsp; หมอดินอาสาประจำอำเภอ และหมอดินอาสาประจำจังหวัดอาสาเข้ามาช่วยกรมพัฒนา&nbsp;</span><span style=\"font-family: sans-serif; font-size: 12px;\">&nbsp;</span><span style=\"font-family: sans-serif; font-size: 12px;\">ที่ดิน ดูแลรักษาทรัพยากรของท้องถิ่น&nbsp; โดยปฏิบัติงานด้านการพัฒนาที่ดิน และเผยแพร่ความรู้ด้านการพัฒนาที่ดินในชุมชนเคียงคู่ไปกับการปฏิบัติงาน&nbsp;</span><span style=\"font-family: sans-serif; font-size: 12px;\">ของเจ้าหน้าที่ของกรมพัฒนาที่ดิน บทบาทของหมอดินอาสาประจำหมู่บ้านในด้านการเผยแพร่ความรู้ด้านการพัฒนาที่ดิน คือ เป็นผู้ทำการเกษตรถูก</span><span style=\"font-family: sans-serif; font-size: 12px;\">ต้องตามหลักวิชาการพัฒนาที่ดิน เป็นตัวอย่างให้กับเกษตรกรข้างเคียง และสามารถให้คำแนะนำ เผยแพร่ความรู้ด้านการพัฒนาที่ดิน ให้แก่เพื่อนบ้าน&nbsp;</span><span style=\"font-family: sans-serif; font-size: 12px;\">ในหมู่บ้าน เป็นผู้ช่วยหรือผู้นำในการจัดตั้งกลุ่มเกษตรกรใช้สารอินทรีย์ทดแทนสารเคมีทางการเกษตร เป็นอาสาสมัครเกษตรที่จะคอยช่วยเหลือเมื่อ</span><span style=\"font-family: sans-serif; font-size: 12px;\">กระทรวงเกษตรและสหกรณ์ มีภารกิจหรือโครงการเร่งด่วนที่ต้องดำเนินการในพื้นที่</span></i></td></tr><tr><td height=\"15\"></td></tr></tbody></table>','/video/w2g_4.mp4',2,50,'2016-11-24 07:09:27',5,'/img/w2g/logo_w2g'),(109,'มะม่วง','มะม่วง','/video/Movie on 16-11-2016 at 12.08.mov',1,51,'2016-11-29 08:21:12',1,'/img/w2g/logo_w2g');
